query:
WITH Company, te_invest, Person
FOR start IN [@name]
FOR v,e,p IN 1..2
ANY start
te_invest
options {bfs:true,uniqueVertices:'path'}

FILTER LAST(p.vertices)._id IN ['Company/ed5cf39b0e708cfbe39ec8ea58a42e60']
LET newEdges=p.edges[
* FILTER true AND (
	(
		(
			(
				CURRENT._from in ['Company/81dcf84eea186e9c04c18b35bcf13bf6','Company/ed5cf39b0e708cfbe39ec8ea58a42e60'] OR (
					!IS_SAME_COLLECTION(
						'Company', CURRENT._from
					) OR (
						IS_SAME_COLLECTION(
							'Company', CURRENT._from
						) AND true and (
							DOCUMENT(
								CURRENT._from
							).reg_city!='大连'
						)
					)
				)
			)
		)
	)
	and
	(
		(
			(
				CURRENT._to in ['Company/81dcf84eea186e9c04c18b35bcf13bf6','Company/ed5cf39b0e708cfbe39ec8ea58a42e60'] OR (
					!IS_SAME_COLLECTION(
						'Company', CURRENT._to
					) OR (
						IS_SAME_COLLECTION(
							'Company', CURRENT._to
						) AND true and (
							DOCUMENT(
								CURRENT._to
							).reg_city!='大连'
						)
					)
				)
			)
		)
	)
) AND IS_SAME_COLLECTION('te_invest', CURRENT._id) AND ((SUBSTRING(CURRENT._from, 0, FIND_FIRST(CURRENT._from, '/')) IN ['', 'Company', 'te_invest', 'Person']) or (CURRENT._from in ['Company/81dcf84eea186e9c04c18b35bcf13bf6','Company/ed5cf39b0e708cfbe39ec8ea58a42e60']))  AND ((SUBSTRING(CURRENT._to, 0, FIND_FIRST(CURRENT._to, '/')) IN ['', 'Company', 'te_invest', 'Person']) or (CURRENT._to in ['Company/81dcf84eea186e9c04c18b35bcf13bf6','Company/ed5cf39b0e708cfbe39ec8ea58a42e60'])) 
return CURRENT
]

FILTER LENGTH(newEdges) > 0 AND LENGTH(newEdges) == LENGTH(p.edges)
LIMIT 0, 500

RETURN p
